window.bookSummaryJSON = "<p>Twelve players set off through the online world of Galactogon, lured by the game owners' promise of an enormous payoff. The question is, who will survive to tell the tale? Which of the 12 is a potential hero - or a traitor in the making? Which of them will defend the weak, and who will become the ultimate evil overlord? A knight or a coward? Each of the 12 will have to choose his or her path. Each will keep a poker face. But if the billion-pound prize calls your name, you can't conceal your choice. And you will do everything to lay your hands on it. </p>"; 
